import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <p>Welcome to the Home Page!</p>
      <Link to="/error-page">
        <button style={{ padding: '10px 20px', fontSize: '16px' }}>
          Go to Error Page
        </button>
      </Link>
    </div>
  );
};

export default Home;
